import React from 'react'

export default class AppPageheader{

    render(props){
        return (
            <div className="page-header page-header-bordered">
                <h1 className="page-title">{props.title}</h1>
                <ol className="breadcrumb">
                    <li className="breadcrumb-item active">
                        {props.detail}
                    </li>
                </ol>
            </div>
        )
    }
}
